import React from 'react';
import './index.css';

export default class Square extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: null,
    };
  }

  render() {
    // use props
    return (
      // alert on click
      <button className='square' onClick={() => alert('click')}>
        {this.props.value}
      </button>
    )
  }
}
